import{_ as a,c as t,o as e,O as s}from"./chunks/framework.1973d67d.js";const r="/assets/wxmini.9bacfa0f.jpg",o="/assets/wx.39f5cbd1.jpg",d="/assets/css3-original-wordmark.d5e18a23.svg",i="/assets/html5-original-wordmark.23042489.svg",n="/assets/sass-original.594ca844.svg",c="/assets/javascript-original.47cbe8cc.svg",v="/assets/typescript-original.e5e372d5.svg",l="/assets/vuejs-original-wordmark.0fe6d924.svg",g="/assets/webpack-original.19fa29d4.svg",p="/assets/nodejs-original-wordmark.e8bb1acc.svg",m="/assets/java-original-wordmark.1910838a.svg",_="/assets/springio-icon.1a12072e.svg",h="/assets/mysql-original-wordmark.c679b6c7.svg",u="/assets/linux-original.718ad039.svg",f="/assets/git-scm-icon.c59eacd1.svg",b="/assets/docker-original-wordmark.3eaa9e40.svg";const I=JSON.parse('{"title":"关于我","description":"","frontmatter":{"prev":false,"next":false,"sidebar":false,"aside":false,"layoutClass":"no-local-nav"},"headers":[],"relativePath":"index.md","filePath":"index.md"}'),k={name:"index.md"},x=s('<h1 id="关于我" tabindex="-1" data-v-682660e9>关于我 <a class="header-anchor" href="#关于我" aria-label="Permalink to &quot;关于我&quot;" data-v-682660e9>​</a></h1><div class="tip custom-block" data-v-682660e9><p class="custom-block-title" data-v-682660e9>TIP</p><p data-v-682660e9>您当前浏览的是由vitepress生成的在线简历， <a href="https://ali.fcbyk.com/file/张明良-简历.pdf" download data-v-682660e9>点击此处可下载PDF版本</a></p></div><p data-v-682660e9>Hello，我是不愉，<strong data-v-682660e9>23年应届毕业生</strong>，关于域名和昵称的由来请 <a href="/about/name" data-v-682660e9>点击这里</a></p><h2 id="教育背景" tabindex="-1" data-v-682660e9>教育背景 <a class="header-anchor" href="#教育背景" aria-label="Permalink to &quot;教育背景&quot;" data-v-682660e9>​</a></h2><p data-v-682660e9>2018年始，在 <strong data-v-682660e9>海南经贸职业技术学院</strong> 学习 <strong data-v-682660e9>计算机网络</strong> 专业，学习了服务器搭建（Linux/Window）、计算机网络理论知识、网络设备互联（调试交换机，路由器）、Java编程，web前端等课程。在校期间通过了计算机二级考试。</p><p data-v-682660e9>2021年，通过统招专升本考试，在 <strong data-v-682660e9>海南热带海洋学院</strong> 学习 <strong data-v-682660e9>计算机科学与技术</strong> 专业，在此期间，系统学习了计算机基础知识（数据结构，计算机网络，计算机组成原理，操作系统，数据库等），同时参加了校内CTF竞赛，荣获三等奖。</p><details class="details custom-block" data-v-682660e9><summary data-v-682660e9>实习经历</summary><p data-v-682660e9>2020年7月-12月，在 <strong data-v-682660e9>海南安一通信网络工程有限公司</strong> 实习， <strong data-v-682660e9>售后工程师</strong> ，主要工作内容是负责海南省中石化监控系统、海口人大常委会机房的运维等。</p></details><h2 id="个人作品" tabindex="-1" data-v-682660e9>个人作品 <a class="header-anchor" href="#个人作品" aria-label="Permalink to &quot;个人作品&quot;" data-v-682660e9>​</a></h2><p data-v-682660e9><strong data-v-682660e9>校园报修系统</strong>（浏览器/服务器）：这个系统是学校数据库课程设计时写的，是一个学生报修，维修人员接单的一个系统。前端使用了Vue2和Element UI 组件库，后端使用Node操作MySQL数据库。该项目现已使用Docker部署至阿里云服务器，<a href="https://cr.fcbyk.com/#/" target="_blank" rel="noreferrer" data-v-682660e9>点击访问</a>。</p><p data-v-682660e9><strong data-v-682660e9>线上逛店小程序</strong>（小程序/服务器）：这是4月写的毕业设计，一个线下商品信息共享平台，每个人都可以发布商品信息。前端使用了微信小程序原生开发（TS+Less），后端使用了SpringBoot，MyBatisPlus等技术。本小程序已上线，搜索 <strong data-v-682660e9><code data-v-682660e9>zml的毕设</code></strong> 或扫描下方小程序码即可访问。</p><p data-v-682660e9>其他作品或未完成的作品请访问我的 <a href="https://github.com/fcbyk" target="_blank" rel="noreferrer" data-v-682660e9>GitHub主页</a></p><img src="'+r+'" alt="wxmini" class="wxmini" data-v-682660e9><h2 id="专业能力" tabindex="-1" data-v-682660e9>专业能力 <a class="header-anchor" href="#专业能力" aria-label="Permalink to &quot;专业能力&quot;" data-v-682660e9>​</a></h2><p data-v-682660e9>本人技术栈已在后续列出，包括但不限于这些的技术，对计算机学科 <u data-v-682660e9><strong data-v-682660e9>有相对的广度，但缺乏深度</strong></u>。有一定写数据结构，写算法的能力，但较弱，也是目前的一个学习方向，偶尔会刷力扣。</p><p data-v-682660e9><u data-v-682660e9><strong data-v-682660e9>善于使用工具和阅读文档</strong></u> 辅助开发，如使用ChatGPT解决遇到的问题，节省开发时间。使用Apifox写 <a href="https://goods-online.apifox.cn/" target="_blank" rel="noreferrer" data-v-682660e9>接口文档</a>，进行接口调式。使用即时设计绘制 <a href="https://js.design/f/-O0fJs?p=NjuH8Hiwv5" target="_blank" rel="noreferrer" data-v-682660e9>前端页面的草稿</a>，把想法记录下来。有阅读文档的习惯，可以通过读文档去使用内置对象和第三方库。</p><p data-v-682660e9><u data-v-682660e9><strong data-v-682660e9>能使用Linux系统</strong></u>，很长一段时间都有接触Linux，大专时使用VMware，本科时买了阿里云服务器和域名。能完成一些基础操作，配置环境，安装软件，部署项目等。</p><p data-v-682660e9><u data-v-682660e9><strong data-v-682660e9>能写前端，也能写后端</strong></u>，但偏前端多一点。本人喜欢前端，喜欢创作，喜欢使用代码去实现自己的一些小想法。接触过vue3，也写过一些组合式API的练习，但暂时没有做过相关的项目。后续会往前端方向学习和发展。希望能能找到一份前端开发的工作。</p><h2 id="联系方式" tabindex="-1" data-v-682660e9>联系方式 <a class="header-anchor" href="#联系方式" aria-label="Permalink to &quot;联系方式&quot;" data-v-682660e9>​</a></h2><p data-v-682660e9>电话：15768604994<br data-v-682660e9> 邮箱：731240932@qq.com<br data-v-682660e9> 微信：fcbyk2023 <button class="wxbtn" data-v-682660e9>[二维码]<img src="'+o+'" alt="正方形图片" data-v-682660e9></button></p><div class="image" data-v-682660e9></div><h2 id="技术栈" tabindex="-1" data-v-682660e9>技术栈 <a class="header-anchor" href="#技术栈" aria-label="Permalink to &quot;技术栈&quot;" data-v-682660e9>​</a></h2><div class="skill" data-v-682660e9><img src="'+d+'" alt="CSS3" data-v-682660e9><img src="'+i+'" alt="HTML5" data-v-682660e9><img src="'+n+'" alt="Sass" data-v-682660e9><img src="'+c+'" alt="JavaScript" data-v-682660e9><img src="'+v+'" alt="TypeScript" data-v-682660e9><img src="'+l+'" alt="Vue.js" data-v-682660e9><img src="'+g+'" alt="Webpack" data-v-682660e9></div><div class="skill" data-v-682660e9><img src="'+p+'" alt="Node.js" data-v-682660e9><img src="'+m+'" alt="Java" data-v-682660e9><img src="'+_+'" alt="Spring" data-v-682660e9><img src="'+h+'" alt="MySQL" data-v-682660e9></div><div class="skill" data-v-682660e9><img src="'+u+'" alt="Linux" data-v-682660e9><img src="'+f+'" alt="Git" data-v-682660e9><img src="'+b+'" alt="Docker" data-v-682660e9></div>',24),w=[x];function q(y,P,S,T,j,L){return e(),t("div",null,w)}const N=a(k,[["render",q],["__scopeId","data-v-682660e9"]]);export{I as __pageData,N as default};
